import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import NavBar from "./components/NavBar"; // Stelle sicher, dass der Pfad korrekt ist
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import ForumList from "./pages/ForumList"; // Beispielseiten hinzuf端gen
import ForumPosts from "./pages/ForumPosts";
import CreateForum from "./pages/CreateForum";

function App() {
    return (
        <Router>
            <div>
                {/* NavBar wird hier global eingef端gt */}
                <NavBar />

                {/* Routing f端r die Seiten */}
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/forums" element={<ForumList />} />
                    <Route path="/forums/:forumId" element={<ForumPosts />} />
                    <Route path="/create-forum" element={<CreateForum />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
